The #[wasm_bindgen] attribute indicates that the function below it will be accessible both in JavaScript and Rust. #[wasm_bindgen]
extern { fn alert(s: &str);
} The extern block imports the external JavaScript function alert into Rust. This declaration is required to call alert from Rust. By declaring it in this way, wasm-bindgen will create JavaScript stubs for alert which allow us to pass strings back and forth between Rust and JavaScript. We can see that the alert function requires a single parameter s of type &str , a string. In Rust, any string literal such as "Hello, test-wasm!" is of type &str . So, alert could be called by writing alert("Hello, test-wasm!"); . We knew to declare alert in this way because it is how we would call alert in JavaScript -- by passing it a string argument. #[wasm_bindgen]
pub fn greet() { alert("Hello, test-wasm!");
} If we were to write the greet function without the #[wasm_bindgen] attribute, then greet would not be easily accessible within JavaScript. Furthermore, we wouldn't be able to natively convert certain types such as &str between JavaScript and Rust. So, both the #[wasm_bindgen] attribute and the prior import of alert allow greet to be called from JavaScript. This is all you need to know to interface with JavaScript, at least to start! You can learn a bunch more by reading the wasm-bindgen documentation ! If you are curious about the rest, read on.

