mod utils; This statement declares a new module named utils that is defined by the contents of utils.rs . Equivalently, we could place the contents of utils.rs inside the utils declaration, replacing the line with: mod utils { // contents of utils.rs
} Either way, the contents of utils.rs define a single public function set_panic_hook . Because we are placing it inside the utils module, we will be able to call the function directly by writing utils::set_panic_hook() . We will discuss how and why to use this function in src/utils.rs . use cfg_if::cfg_if; use allows us to conveniently refer to parts of a crate or module. For example, suppose the crate cfg_if contains a function func . It is always possible to call this function directly by writing cfg_if::func() . However, this is often tedious to write. If we first specify use cfg_if::func; , then func can be called by just writing func() instead. You can learn more about how Rust let's you write modular code in this chapter of the book . With this in mind, this use allows us to call the macro cfg_if! inside the crate cfg_if without writing cfg_if::cfg_if! . We use cfg_if! to configure wee_alloc , which we will talk more about in a separate section : cfg_if! { if #[cfg(feature = "wee_alloc")] { extern crate wee_alloc; #[global_allocator] static ALLOC: wee_alloc::WeeAlloc = wee_alloc::WeeAlloc::INIT; }
} We immediately notice that cfg_if! is a macro because it ends in ! , similarly to other Rust macros such as println! and vec! . A macro is directly replaced by other code during compile time. During compile time, cfg_if! evaluates the if statement. This tests whether the feature wee_alloc is present in the [features] section of Cargo.toml (among other possible ways to set it). As we saw earlier, the default vector in [features] only contains "console_error_panic_hook" and not "wee_alloc" . So, in this case, the cfg_if! block will be replaced by no code at all, and hence the default memory allocator will be used instead of wee_alloc . use wasm_bindgen::prelude::*; Many modules contain a prelude, a list of things that should be automatically imported. This allows common features of the module to be conveniently accessed without a lengthy prefix. For example, in this file we can use #[wasm_bindgen] only because it is brought into scope by the prelude. The asterisk at the end of this use indicates that everything inside the module wasm_bindgen::prelude (i.e. the module prelude inside the crate wasm_bindgen ) can be referred to without prefixing it with wasm_bindgen::prelude . For example, #[wasm_bindgen] could also be written as #[wasm_bindgen::prelude::wasm_bindgen] , although this is not recommended.

