use cfg_if::cfg_if; This allows us to write cfg_if! instead of cfg_if::cfg_if! , identically to the line in src/lib.rs . cfg_if! { if #[cfg(feature = "console_error_panic_hook")] { extern crate console_error_panic_hook; pub use self::console_error_panic_hook::set_once as set_panic_hook; } else { #[inline] pub fn set_panic_hook() {} }
} As described in the preceding section, the macro cfg_if! evaluates the if statement during compile time. This is possible because it is essentially testing whether "console_error_panic_hook" is defined in the [features] section of Cargo.toml , which is available during compile time. The entire macro block will either be replaced with the statements in the if block or with those in the else block. These two cases are now described in turn: extern crate console_error_panic_hook;
pub use self::console_error_panic_hook::set_once as set_panic_hook; Due to the use statement, the function self::console_error_panic_hook::set_once can now be accessed more conveniently as set_panic_hook . Due to pub , this function will be publicly accessible outside of the utils module as utils::set_panic_hook . #[inline]
pub fn set_panic_hook() {} An inline function replaces the function call with the contents of the function during compile time. Here, set_panic_hook is defined to be an empty inline function. This allows the use of set_panic_hook without any run-time or code-size performance penalty if the feature is not enabled.

