In lib.rs , we have the configuration for wee_alloc inside a cfg_if! macro: cfg_if! { if #[cfg(feature = "wee_alloc")] { extern crate wee_alloc; #[global_allocator] static ALLOC: wee_alloc::WeeAlloc = wee_alloc::WeeAlloc::INIT; }
} This code block is intended to initialize wee_alloc as the global memory allocator, but only if the wee_alloc feature is enabled in Cargo.toml . To do so we need to append "wee_alloc" to the default vector in Cargo.toml . Then, the cfg_if! block is replaced with the contents of the if block, shown above. [features]
default = ["console_error_panic_hook", "wee_alloc"]
